        "System.Description": "VCS Branch: zeus-1_0_2-1912<hr>On the attached screen shot of the Non-Client Cash Transaction screen in Zeus for the Foreign Exchange transaction only, open up the following three fields in the Identification section of the screen to be passed to Norkom or Patriot Officer.\r<br>1. SSN or Alien ID Number\r<br>2. DOB (Date of Birth)\r<br>3. Full Address\r<br>\r<br>**Make these fields required.\r<br>\r<br>NOTE: The SSN, DOB, and Address should only be required during the Non-Client Foreign Exchange transaction.  After the 12/12 Zeus Roll-out, we learned the non-client\u2019s SSN, DOB, and Address were required during all Non-Client transactions instead of just Foreign Exchange. I've attached some screenshots of the errors reported before we backed out the changes. \r<br>\r<br>This is a compliance mandated change.<hr>Reporter: Mohammed Mohiuddin<hr>External ID: 1912<hr>Components: <hr>Affiliates validated: ZFNB,VBC,CBT,ABT,NSB,NBA<hr>Affiliates affected: NBA,NSB,VBC,ZFNB,ABT,CBT<hr>Affiliates checked: VBC,ZFNB,CBT,NBA<hr>Original assignee: Trung Thai<hr>Found with a Test Case",
